using namespace std;

int main() {
    string s;
    cin >> s;

    // Check for uppercase letters
    for (char c : s) {
        if (c < 'a' || c > 'z') {
            cout << "Invalid!" << endl;
            return 0;
        }
    }

    int vowelCount = 0;
    for (char c : s) {
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            ++vowelCount;
        }
    }

    cout << vowelCount << endl;
    return 0;
}

